import color from "@material-ui/core/colors/lime";

export const styles = theme => ({
  "@global": {
    body: {
      margin: 0
    },
    "#__next": {
      // background: "yellow"
    }
  },
  root: {
    backgroundColor: "black"
  },
    container: {
      // background: "green",
      display: "flex",
      maxWidth: 1280,
      margin: "auto"
    },
    upperFooter: {
      borderBottom: `solid 1px #2f3033`,
      "& > $container": {
        height: 88,
        display: 'flex'
      }
    },
    beetwenFooter: {
      borderBottom: `solid 1px #2f3033`,
      "& > $container": {
        height: 206,
        display: "flex"
      }
    },
    lowerFooter: {
      borderBottom: `solid 1px #2f3033`,
      "& > $container": {
        height: 58,
        display: "flex"
        }
    },
    logo: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      color: 'white'

    },
    categories: {
      display: "flex",
      alignItems: "center",
      "& > div": {
        width: 100,
        display: "flex",
        color: 'white'
      }
    },
    emptySpacing: {
      flexGrow: 1
    }
});
